	(148, 1, 17, 3, 3, 0, 'test thong tin du aniooii', 'Hai trong số 4 hành tinh mà Kunimoto phát hiện có kích thước tương tự Trái Đất, trong khi một hành tinh khác lớn hơn sao Thủy đôi chút. Hành tinh thứ tư có tên Kepler Object of Interest (KOI) 408.05, lớn gần bằng sao Hải Vương.  KOI-408.05 là hành tinh gây chú ý nhất bởi nó nằm trong khu vực có thể tồn tại sự sống tính từ ngôi sao mẹ. Đây có thể là ứng viên tiềm năng để tìm ra nước lỏng và dấu hiệu của sự sống ngoài Trái Đất. Hành tinh này ở cách Trái Đất khoảng 3.200 năm ánh sáng. Theo Kunimoto, xung quanh KOI-408.05 có thể là một số mặt trăng lớn hơn các hành tinh của hệ Mặt Trời và nhiều khả năng một trong số đó chứa đại dương nước lỏng.Hai trong số 4 hành tinh mà Kunimoto phát hiện có kích thước tương tự Trái Đất, trong khi một hành tinh khác lớn hơn sao Thủy đôi chút. Hành tinh thứ tư có tên Kepler Object of Interest (KOI) 408.05, lớn gần bằng sao Hải Vương.  KOI-408.05 là hành tinh gây chú ý nhất bởi nó nằm trong khu vực có thể tồn tại sự sống tính từ ngôi sao mẹ. Đây có thể là ứng viên tiềm năng để tìm ra nước lỏng và dấu hiệu của sự sống ngoài Trái Đất. Hành tinh này ở cách Trái Đất khoảng 3.200 năm ánh sáng. Theo Kunimoto, xung quanh KOI-408.05 có thể là một số mặt trăng lớn hơn các hành tinh của hệ Mặt Trời và nhiều khả năng một trong số đó chứa đại dương nước lỏng.Hai trong số 4 hành tinh mà Kunimoto phát hiện có kích thước tương tự Trái Đất, trong khi một hành tinh khác lớn hơn sao Thủy đôi chút. Hành tinh thứ tư có tên Kepler Object of Interest (KOI) 408.05, lớn gần bằng sao Hải Vương.  KOI-408.05 là hành tinh gây chú ý nhất bởi nó nằm trong khu vực có thể tồn tại sự sống tính từ ngôi sao mẹ. Đây có thể là ứng viên tiềm năng để tìm ra nước lỏng và dấu hiệu của sự sống ngoài Trái Đất. Hành tinh này ở cách Trái Đất khoảng 3.200 năm ánh sáng. Theo Kunimoto, xung quanh KOI-408.05 có thể là một số mặt trăng lớn hơn các hành tinh của hệ Mặt Trời và nhiều khả năng một trong số đó chứa đại dương nước lỏng.Hai