	(59, 1, 148, 16, 0, 0, 'Một sinh viên 22 tuổi người Canada bất ngờ phát hiện 4 hành tinh mới, trong đó hai hành tinh có kích thước gần giống Trái Đất và một hành tinh nằm trong khu vực có thể tồn tại sự sống.Một sinh viên 22 tuổi người Canada bất ngờ phát hiện 4 hành tinh mới, trong đó hai hành tinh có kích thước gần giống Trái Đất và một hành tinh nằm trong khu vực có thể tồn tại sự sống.Một sinh viên 22 tuổi người Canada bất ngờ phát hiện 4 hành tinh mới, trong đó hai hành tinh có kích thước gần giống Trái Đất và một hành tinh nằm trong khu vực có thể tồn tại sự sống.', 'Một sinh viên 22 tuổi người Canada bất ngờ phát hiện 4 hành tinh mới, trong đó hai hành tinh có kích thước gần giống Trái Đất và một hành tinh nằm trong khu vực có thể tồn tại sự sống.Một sinh viên 22 tuổi người Canada bất ngờ phát hiện 4 hành tinh mới, trong đó hai hành tinh có kích thước gần giống Trái Đất và một hành tinh nằm trong khu vực có thể tồn tại sự sống.Một sinh viên 22 tuổi người Canada bất ngờ phát hiện 4 hành tinh mới, trong đó hai hành tinh có kích thước gần giống Trái Đất và một hành tinh nằm trong khu vực có thể tồn tại sự sống.', b'0', 1464793340, 1464793340, 16, 16, b'0'),
	(60, 1, 148, 16, 0, 0, 'Theo Tech Times, nữ sinh viên Michelle Kunimoto ở Đại học British Columbia (UBC), Canada, được giao bài tập phân tích dữ liệu về những đường cong ánh sáng khác nhau do kính viễn vọng Kepler của Cơ quan Hàng không Vũ trụ Mỹ (NASA) thu thập. Nhiệm vụ của Kunimoto là tìm kiếm thông tin mới mà các nhà nghiên cứu có thể bỏ sót.\n\n"Ngôi sao chỉ là một chấm sáng nhỏ, do đó tôi xem xét những lần ánh sáng của ngôi sao giảm đi mỗi khi có một hành tinh đi ngang qua phía trước nó", Kunimoto cho biết.\n\nJaymie Matthews, thành viên hội đồng quản lý Kepler đồng thời là giáo sư thiên văn của Kunimoto ở trường đại học, cho biết các nhà nghiên cứu không tìm hiểu kỹ hơn thông tin ông giao cho Kunimoto bởi chúng thường chỉ ra kết quả sai. Tuy nhiên, Matthews tin chắc 4 hành tinh do Kunimoto tìm ra sẽ sớm được xác nhận.', 'Theo Tech Times, nữ sinh viên Michelle Kunimoto ở Đại học British Columbia (UBC), Canada, được giao bài tập phân tích dữ liệu về những đường cong ánh sáng khác nhau do kính viễn vọng Kepler của Cơ quan Hàng không Vũ trụ Mỹ (NASA) thu thập. Nhiệm vụ của Kunimoto là tìm kiếm thông tin mới mà các nhà nghiên cứu có thể bỏ sót.\n\n"Ngôi sao chỉ là một chấm sáng nhỏ, do đó tôi xem xét những lần ánh sáng của ngôi sao giảm đi mỗi khi có một hành tinh đi ngang qua phía trước nó", Kunimoto cho biết.\n\nJaymie Matthews, thành viên hội đồng quản lý Kepler đồng thời là giáo sư thiên văn của Kunimoto ở trường đại học, cho biết các nhà nghiên cứu không tìm hiểu kỹ hơn thông tin ông giao cho Kunimoto bởi chúng thường chỉ ra kết quả sai. Tuy nhiên, Matthews tin chắc 4 hành tinh do Kunimoto tìm ra sẽ sớm được xác nhận.', b'0', 1464793380, 1464793380, 16, 16, b'0'),
	(61, 1, 148, 16, 0, 0, 'Hai trong số 4 hành tinh mà Kunimoto phát hiện có kích thước tương tự Trái Đất, trong khi một hành tinh khác lớn hơn sao Thủy đôi chút. Hành tinh thứ tư có tên Kepler Object of Interest (KOI) 408.05, lớn gần bằng sao Hải Vương.', 'Hai trong số 4 hành tinh mà Kunimoto phát hiện có kích thước tương tự Trái Đất, trong khi một hành tinh khác lớn hơn sao Thủy đôi chút. Hành tinh thứ tư có tên Kepler Object of Interest (KOI) 408.05, lớn gần bằng sao Hải Vương.', b'0', 1464793398, 1464793398, 16, 16, b'0'),
	(62, 1, 148, 16, 0, 0, 'Hai trong số 4 hành tinh mà Kunimoto phát hiện có kích thước tương tự Trái Đất, trong khi một hành tinh khác lớn hơn sao Thủy đôi chút. Hành tinh thứ tư có tên Kepler Object of Interest (KOI) 408.05, lớn gần bằng sao Hải Vương.\n\nKOI-408.05 là hành tinh gây chú ý nhất bởi nó nằm trong khu vực có thể tồn tại sự sống tính từ ngôi sao mẹ. Đây có thể là ứng viên tiềm năng để tìm ra nước lỏng và dấu hiệu của sự sống ngoài Trái Đất. Hành tinh này ở cách Trái Đất khoảng 3.200 năm ánh sáng. Theo Kunimoto, xung quanh KOI-408.05 có thể là một số mặt trăng lớn hơn các hành tinh của hệ Mặt Trời và nhiều khả năng một trong số đó chứa đại dương nước lỏng.\n\nXem thêm: Cậu bé 15 tuổi tìm thấy thành phố cổ đại Maya trong rừng già', 'Hai trong số 4 hành tinh mà Kunimoto phát hiện có kích thước tương tự Trái Đất, trong khi một hành tinh khác lớn hơn sao Thủy đôi chút. Hành tinh thứ tư có tên Kepler Object of Interest (KOI) 408.05, lớn gần bằng sao Hải Vương.\n\nKOI-408.05 là hành tinh gây chú ý nhất bởi nó nằm trong khu vực có thể tồn tại sự sống tính từ ngôi sao mẹ. Đây có thể là ứng viên tiềm năng để tìm ra nước lỏng và dấu hiệu của sự sống ngoài Trái Đất. Hành tinh này ở cách Trái Đất khoảng 3.200 năm ánh sáng. Theo Kunimoto, xung quanh KOI-408.05 có thể là một số mặt trăng lớn hơn các hành tinh của hệ Mặt Trời và nhiều khả năng một trong số đó chứa đại dương nước lỏng.\n\nXem thêm: Cậu bé 15 tuổi tìm thấy thành phố cổ đại Maya trong rừng già', b'0', 1464793427, 1464793427, 16, 16, b'0'),
	(63, 1, 150, 2, 0, 0, 'Bí thư Thăng tiếp tục kêu gọi cơ chế đặc thù cho TP HCM\nLàm việc về cơ chế tài chính cho địa phương, ông Đinh La Thăng cho rằng TP HCM cần "mặc một cái áo vừa cho sự phát triển", trong khi "chiếc áo" hiện nay đã quá chật và bí bách.', 'Bí thư Thăng tiếp tục kêu gọi cơ chế đặc thù cho TP HCM\nLàm việc về cơ chế tài chính cho địa phương, ông Đinh La Thăng cho rằng TP HCM cần "mặc một cái áo vừa cho sự phát triển", trong khi "chiếc áo" hiện nay đã quá chật và bí bách.', b'0', 1465362965, 1465362965, 2, 2, b'0'),
	(64, 1, 150, 2, 0, 0, 'Bí thư Thăng: \'Cái tôi muốn là cơ chế của một đặc khu cho TP HCM\' / TP HCM ấp ủ mô hình đặc khu kinh tế như thế nào\nQuan điểm về cơ chế tài chính đối với địa phương được lãnh đạo TP HCM đưa ra tại buổi làm việc với đoàn Ủy ban Tài chính - Ngân sách Quốc hội ngày 7/6. Trước đó, Giám đốc Sở Tài chính Phan Thị Thắng cho biết thành phố luôn tự bảo đảm cân đối ngân sách và tỷ lệ số thu nộp về ngân sách Trung ương cao nhất so với 63 tỉnh thành.', 'Bí thư Thăng: \'Cái tôi muốn là cơ chế của một đặc khu cho TP HCM\' / TP HCM ấp ủ mô hình đặc khu kinh tế như thế nào\nQuan điểm về cơ chế tài chính đối với địa phương được lãnh đạo TP HCM đưa ra tại buổi làm việc với đoàn Ủy ban Tài chính - Ngân sách Quốc hội ngày 7/6. Trước đó, Giám đốc Sở Tài chính Phan Thị Thắng cho biết thành phố luôn tự bảo đảm cân đối ngân sách và tỷ lệ số thu nộp về ngân sách Trung ương cao nhất so với 63 tỉnh thành.', b'0', 1465363045, 1465363045, 2, 2, b'0'),
	(65, 1, 150, 16, 0, 0, 'Tuy nhiên, theo nghị quyết của Bộ chính trị, tỷ lệ điều tiết để lại cho TP HCM từ số thu nêu trên là 33% nhưng từ năm 2011 đến 2015 chỉ còn để lại 23%. Lãnh đạo địa phương so sánh dù thu ngân sách chiếm 27% so tổng thu của với cả nước, nhưng tổng chi để lại trên địa bàn TP HCM chỉ khoảng 4%.', 'Tuy nhiên, theo nghị quyết của Bộ chính trị, tỷ lệ điều tiết để lại cho TP HCM từ số thu nêu trên là 33% nhưng từ năm 2011 đến 2015 chỉ còn để lại 23%. Lãnh đạo địa phương so sánh dù thu ngân sách chiếm 27% so tổng thu của với cả nước, nhưng tổng chi để lại trên địa bàn TP HCM chỉ khoảng 4%.', b'0', 1465363089, 1465363089, 16, 16, b'0'),
