	(84, 1, 152, 2, 0, 0, 'Mục đích của dự án là liên kết máy tính nối mạng Internet trên thế giới nhằm tạo ra một thế hệ máy tính mới cực mạnh. Điều này cực kỳ cần thiết, bởi vì trong khoa học có những vấn đề rất lớn, bản thân một máy tính không thể xử lý nổi. Ban đầu, mạng Grid sẽ tập trung giải quyết lượng dữ liệu do máy gia tốc hạt LHC cung cấp. Đây là thiết bị thử nghiệm thuyết Vụ nổ lớn (Big Bang) bằng cách cho các proton va vào nhau trong môi trường năng lượng cao.\n------------\nXem thêm: Khởi công dự án mạng máy tính lớn nhất thế giới - Tin Khoa Hoc, http://vietbao.vn/Khoa-hoc/Khoi-cong-du-an-mang-may-tinh-lon-nhat-the-gioi/20031387/188/\nTin nhanh Việt Nam ra thế giới vietbao.vn', 'Mục đích của dự án là liên kết máy tính nối mạng Internet trên thế giới nhằm tạo ra một thế hệ máy tính mới cực mạnh. Điều này cực kỳ cần thiết, bởi vì trong khoa học có những vấn đề rất lớn, bản thân một máy tính không thể xử lý nổi. Ban đầu, mạng Grid sẽ tập trung giải quyết lượng dữ liệu do máy gia tốc hạt LHC cung cấp. Đây là thiết bị thử nghiệm thuyết Vụ nổ lớn (Big Bang) bằng cách cho các proton va vào nhau trong môi trường năng lượng cao.\n------------\nXem thêm: Khởi công dự án mạng máy tính lớn nhất thế giới - Tin Khoa Hoc, http://vietbao.vn/Khoa-hoc/Khoi-cong-du-an-mang-may-tinh-lon-nhat-the-gioi/20031387/188/\nTin nhanh Việt Nam ra thế giới vietbao.vn', b'0', 1465549689, 1465549689, 2, 2, b'0'),
	(85, 1, 152, 2, 0, 0, 'Hàng năm, lượng thông tin do cuộc thử nghiệm này cung cấp tương đương với dung lượng của 20 triệu đĩa CD; đòi hỏi phải có khoảng 70.000 máy tính mới phân tích được. Với Grid, các nhà khoa học có thể tiếp cận nguồn lực máy tính trên khắp thế giới. Les Robertson, Giám đốc dự án của CERN, cho biết: "Mạng Grid cho phép chúng ta khai thác được sức mạnh của các trung tâm máy tính khoa học khắp mọi nơi, nhằm cung cấp nguồn lực máy tính mạnh nhất mà thế giới hiện có".\n------------\nXem thêm: Khởi công dự án mạng máy tính lớn nhất thế giới - Tin Khoa Hoc, http://vietbao.vn/Khoa-hoc/Khoi-cong-du-an-mang-may-tinh-lon-nhat-the-gioi/20031387/188/\nTin nhanh Việt Nam ra thế giới vietbao.vn', 'Hàng năm, lượng thông tin do cuộc thử nghiệm này cung cấp tương đương với dung lượng của 20 triệu đĩa CD; đòi hỏi phải có khoảng 70.000 máy tính mới phân tích được. Với Grid, các nhà khoa học có thể tiếp cận nguồn lực máy tính trên khắp thế giới. Les Robertson, Giám đốc dự án của CERN, cho biết: "Mạng Grid cho phép chúng ta khai thác được sức mạnh của các trung tâm máy tính khoa học khắp mọi nơi, nhằm cung cấp nguồn lực máy tính mạnh nhất mà thế giới hiện có".\n------------\nXem thêm: Khởi công dự án mạng máy tính lớn nhất thế giới - Tin Khoa Hoc, http://vietbao.vn/Khoa-hoc/Khoi-cong-du-an-mang-may-tinh-lon-nhat-the-gioi/20031387/188/\nTin nhanh Việt Nam ra thế giới vietbao.vn', b'0', 1465549709, 1465549709, 2, 2, b'0'),
	(86, 1, 152, 16, 0, 0, 'Mục tiêu lớn nhất của Grid là tập trung sức mạnh máy tính của các trung tâm khoa học trên toàn thế giới nhằm tạo ra một mạng lưới siêu máy tính. Về lâu dài, giới khoa học dự đoán Grid sẽ tạo nên một cuộc cách mạng trong thế giới máy tính. Hơn tất cả, mạng lưới này sẽ cung cấp sức mạnh xử lý cực lớn cho bất kỳ máy tính nối mạng nào.\n------------\nXem thêm: Khởi công dự án mạng máy tính lớn nhất thế giới - Tin Khoa Hoc, http://vietbao.vn/Khoa-hoc/Khoi-cong-du-an-mang-may-tinh-lon-nhat-the-gioi/20031387/188/\nTin nhanh Việt Nam ra thế giới vietbao.vn', 'Mục tiêu lớn nhất của Grid là tập trung sức mạnh máy tính của các trung tâm khoa học trên toàn thế giới nhằm tạo ra một mạng lưới siêu máy tính. Về lâu dài, giới khoa học dự đoán Grid sẽ tạo nên một cuộc cách mạng trong thế giới máy tính. Hơn tất cả, mạng lưới này sẽ cung cấp sức mạnh xử lý cực lớn cho bất kỳ máy tính nối mạng nào.\n------------\nXem thêm: Khởi công dự án mạng máy tính lớn nhất thế giới - Tin Khoa Hoc, http://vietbao.vn/Khoa-hoc/Khoi-cong-du-an-mang-may-tinh-lon-nhat-the-gioi/20031387/188/\nTin nhanh Việt Nam ra thế giới vietbao.vn', b'0', 1465549741, 1465549741, 16, 16, b'0'),
