	(173, 1, 161, 13, 0, 0, 'TRẢ LỜI:\n\nNguyên nhân chính ở đây là do máy tính của bạn còn thiếu font chữ nên không thể hiển thị khi mở trên máy của bạn. Vậy để khắc phục tình trạng này bạn nên tải bộ font chữ cho máy tính hoặc tải bộ Font full về cài đặt trên máy tính sẽ hết.\n\nTiện đây chúng tôi cũng xin hướng dẫn các bạn cách cài đặt font chữ trên máy tính.\nĐể cài đặt được font chữ trên máy tính bạn có thể thực hiện theo hai cách sau:', 'TRẢ LỜI:\n\nNguyên nhân chính ở đây là do máy tính của bạn còn thiếu font chữ nên không thể hiển thị khi mở trên máy của bạn. Vậy để khắc phục tình trạng này bạn nên tải bộ font chữ cho máy tính hoặc tải bộ Font full về cài đặt trên máy tính sẽ hết.\n\nTiện đây chúng tôi cũng xin hướng dẫn các bạn cách cài đặt font chữ trên máy tính.\nĐể cài đặt được font chữ trên máy tính bạn có thể thực hiện theo hai cách sau:', b'0', 1467684648, 1467684648, 13, 13, b'0'),
	(174, 1, 161, 13, 0, 0, 'CÁCH 1: MỞ QUA WINDOWS EXPLORER\n\nBước 1: Mở thư mục chứa các font chứ vừa tải về, chọn một font chữ mà bạn muốn cài hoặc chọn toàn bộ các Font chữ trong thư mục đó bằng cách sử dụng tổ hợp phím Ctrl + A.\n\nClick chuột phải vào các Font chữ vừa chọn --> Copy (hoặc sử dụng tổ hợp phím Ctrl +C)', 'CÁCH 1: MỞ QUA WINDOWS EXPLORER\n\nBước 1: Mở thư mục chứa các font chứ vừa tải về, chọn một font chữ mà bạn muốn cài hoặc chọn toàn bộ các Font chữ trong thư mục đó bằng cách sử dụng tổ hợp phím Ctrl + A.\n\nClick chuột phải vào các Font chữ vừa chọn --> Copy (hoặc sử dụng tổ hợp phím Ctrl +C)', b'0', 1467684670, 1467684670, 13, 13, b'0'),
